import{_ as e,o,c as t,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 38.2-1320.2 Filing of report on examination.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-1320.2.md","filePath":"vacode/38.2-1320.2.md"}'),n={name:"vacode/38.2-1320.2.md"},a=i('<h1 id="§-38-2-1320-2-filing-of-report-on-examination" tabindex="-1">§ 38.2-1320.2 Filing of report on examination. <a class="header-anchor" href="#§-38-2-1320-2-filing-of-report-on-examination" aria-label="Permalink to &quot;§ 38.2-1320.2 Filing of report on examination.&quot;">​</a></h1><p>Within thirty days of the end of the period allowed for the receipt of written submissions, the Commission shall fully consider and review the report, together with any written submissions and any relevant portions of the examiner&#39;s workpapers and act upon the report by:</p><ol><li><p>Certifying that the examination report as initially provided to the person examined, or with modifications or corrections, is the Commission&#39;s true examination report and filing such report in the offices of the Commission;</p></li><li><p>Rejecting the examination report with notice to the person examined that the Commission&#39;s examiners are being directed to reopen the examination for purposes of obtaining additional data, documentation or information, and resubmission pursuant to § <a href="http://law.lis.virginia.gov/vacode/38.2-1320.1/" target="_blank" rel="noreferrer">38.2-1320.1</a>; or</p></li><li><p>Calling for an investigatory hearing before the Commission with no less than ten days&#39; notice to the company for purposes of obtaining additional documentation, data, information and testimony.</p></li></ol><p>1992, c. 588.</p>',4),r=[a];function s(p,d,l,h,m,c){return o(),t("div",null,r)}const u=e(n,[["render",s]]);export{_ as __pageData,u as default};
